import React from "react";
import { Link } from 'react-router-dom';
// import Auth from '../../utils/auth';
import {
  FaThList,
  FaCampground,
  FaHome,
  FaGamepad,
  FaGuitar
} from 'react-icons/fa';

function Navbar() {
  const menuItems = [
    {
      path:'/',
      name: 'Landing',
      icon:<FaHome/>
    },
    {
      path:'/events',
      name: 'Events',
      icon:<FaGuitar/>
    },
    {
      path:'/outdoors',
      name: 'Outdoors',
      icon:<FaCampground/>
    },
    {
      path:'/indoors',
      name: 'Indoors',
      icon:<FaGamepad/>
    }
  ]
  return (
    <div className="containter">
      <div className="navbar">
        <div className="top-section">
          <h1 className="logo">Logo</h1>
          <div className="bars">
            <FaThList/>
          </div>

        </div>

      </div>
    </div>
  )
}

export default Navbar;
